import React from 'react';
import News from './News';
import Accounts from './Accounts';
import './style.css';


export default function Dashboard() {
  return(
    <div className="Dashboard">
      <h1>Faria Financial Management</h1>
      <Accounts />
      <News />
    </div>
  );
};
